import { Injector,Injectable } from "@angular/core";



export class PostService{
    @Injectable(
        providedIn:'root'})
    PostList:Array<any>=[
        {postId:1,postTitle:'Post1'},
        {postId:2,postTitle:'Post2'},
        {postId:3,postTitle:'Post3'},
        {postId:4,postTitle:'Post4'}
